import React, { Component } from "react";
import { GoogleMap, withScriptjs, withGoogleMap } from 'react-google-maps';

function Map() {

    const containerStyle = {
        width: '400px',
        height: '400px'
    };

    const center = {
        lat: 40.7128,
        lng: 74.0060
    };

    const WrappedMap = withScriptjs(withGoogleMap(renderMap))


    function renderMap() {
          return (
            <GoogleMap
              center={center}
              zoom={10}
            />
          )
    }

    return(
      <div>
        <WrappedMap googleMpaURL={"https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places"}/>
      </div>
    )
}

export default Map;
